import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="cv-input">
        <h1>CV Input</h1>
      </div>
      <div className="cv-output">
        <h1>CV Output</h1>
      </div>
    </div>
  );
}

export default App;
